Description:
Player enters a crouching aim stance to enhance shooting performance. While in this stance, shots deal &lt;font face="lyshineui/fonts/Nimbus_SemiBold.font" color="#ffd45f"&gt;{[DamageTable.MusketAttack_ShootersStance.DmgCoef * 100]}%&lt;/font&gt; &lt;img src="lyshineui/images/icons/tooltip/icon_tooltip_thrust_opaque" xPadding="4" scale="1.7" yOffset="4"&gt;&lt;/img&gt;weapon damage, mobility is reduced to zero and &lt;font face="lyshineui/fonts/Nimbus_SemiBold.font" color="#ffd45f"&gt;reload&lt;/font&gt; time is reduced by &lt;font face="lyshineui/fonts/Nimbus_SemiBold.font" color="#ffd45f"&gt;75%&lt;/font&gt;. 

Shooter's Stance ends after &lt;font face="lyshineui/fonts/Nimbus_SemiBold.font" color="#ffd45f"&gt;3&lt;/font&gt; shots.

&lt;font face="lyshineui/fonts/Nimbus_Regular_Italic.font" color="#828282"&gt;(Power shot and powder burn can be used while inside shooter's stance.)&lt;/font&gt;
